    render(){
        const name = 'iris';
        const loading = true;
        const showName = false;
        return(
            <div className ='App'>
                {loading ? <h4>Loading</h4> : <h1>Hello {showName && name}</h1>}
            </div>
        );
    }
}
export default App;
